import React from 'react';
import { Route, Routes, Navigate } from 'react-router-dom';
import Home from './components/Home';

function PrivateRoute({ element, path }) {
  const isAuthenticated = /* Check if user is authenticated */ true;

  return isAuthenticated ? (
    <Route path={path} element={element} />
  ) : (
    <Navigate to="/login" replace />
  );
}

function App() {
  return (
    <div className="App">
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/login" element={<Login />} />
        <Route path="/registration" element={<Signup />} />

        {/* Use PrivateRoute for protected routes */}
        <PrivateRoute path="/appointment" element={<Appointment />} />
        <PrivateRoute path="/dashboard" element={<VisitorDashboard />} />
        <PrivateRoute path="/admin-dashboard" element={<Dashboard />} />
      </Routes>
    </div>
  );
}

export default App;
